    public LatinaDictionary() throws IOException {
        wordList = new HashSet<String>();
        String word = new String();
		
		String regex = new String();
		Pattern pattern = null;
		Matcher matcher;
		
		regex = "\\S+";
		pattern = Pattern.compile(regex);
		matcher = pattern.matcher(my_dictionary);
		
		while(matcher.find())	{
			word = my_dictionary.substring(matcher.start(), matcher.end());
			wordList.add(word.toUpperCase());
		}
        buildDAWG();
    }
    
