    public boolean isWord(String s) {
        LatinaDawgNode node = root;
        for (int j = 0; j < s.length(); j++) {
                node = node.getChild(s.charAt(j));
                if (node == null) return false;
        }
        return node.isTerminalState();
    }

    public LatinaDawgNode getRoot() {
        return root;
    }

    public boolean[] fillInBlank(String prefix, String suffix) {
        boolean[] checks = new boolean[26];
        for (int i = 0; i < 26; i++) {
            checks[i] = isWord(prefix + (char) ('A' + i) + suffix);
        }
        return checks;
    }

    public static void writeDawg(String filename) throws IOException {
        ObjectOutputStream output = new ObjectOutputStream(new FileOutputStream(filename));
        output.writeObject(new LatinaDictionary());
        output.close();
    }
    
    public void buildDAWG() throws IOException {
        ArrayList<LatinaTrieNode> trie = buildTrie();
        ArrayList<LatinaDawgNode> dawg = buildInitialDawg(trie);
        int[] newPartition = new int[dawg.size()];
        int[] oldPartition;
        for (int i = 0; i < newPartition.length; i++) {
            if (dawg.get(i).isTerminalState()) newPartition[i] = 1;
            else newPartition[i] = 2;
        }
        boolean change = true;
        int nextPartNum = 1;
        while (change) {
            nextPartNum = 1;
            change = false;
            oldPartition = newPartition;
            newPartition = new int[dawg.size()];
            for (int i = 0; i < dawg.size(); i++) {
                LatinaDawgNode node1 = dawg.get(i);
                if (i%1000 == 0) System.out.println(i + " out of " + dawg.size());
                if (newPartition[i] == 0) {
                    newPartition[i] = nextPartNum++;
                    for (int j = i+1; j < dawg.size(); j++) {
                        boolean match = true;
                        if (oldPartition[i] != oldPartition[j])
                            match = false;
                        else {
                            LatinaDawgNode node2 = dawg.get(j);
                            int childIndex = 0;
                            LatinaDawgNode child1 = node1.getChild(childIndex);
                            LatinaDawgNode child2 = node2.getChild(childIndex);
                            while (child1 != null && child2 != null) {
                                if (node1.getChar(childIndex) != node2.getChar(childIndex)
                                        || (oldPartition[child1.getIndexInDawg()]
                                        != oldPartition[child2.getIndexInDawg()]))
                                    break;
                                childIndex++;
                                child1 = node1.getChild(childIndex);
                                child2 = node2.getChild(childIndex);
                            }
                            if (child1 != null || child2 != null) {
                                match = false;
                                change = true;
                            }
                        }
                        if (match) newPartition[j] = newPartition[i];
                    }
                }
            }
        }

        LatinaDawgNode[] minimalDawg = new LatinaDawgNode[nextPartNum-1];
        boolean[] checks = new boolean[nextPartNum-1];
        for (int i = 0; i < dawg.size(); i++) {
            if (minimalDawg[newPartition[i]-1] == null)
                minimalDawg[newPartition[i]-1] = new LatinaDawgNode(dawg.get(i).getNumChildren());
        }

        for (int i = 0; i < dawg.size(); i++) {
            if (!checks[newPartition[i]-1]) {
                checks[newPartition[i]-1] = true;
                LatinaDawgNode node = dawg.get(i);
                for (int j = 0; j < node.getNumChildren(); j++) {
                    minimalDawg[newPartition[i]-1].addChild(node.getChar(j),
                            minimalDawg[newPartition[node.getChild(j).getIndexInDawg()]-1]);
                }
                if (node.isTerminalState()) minimalDawg[newPartition[i]-1].setTerminalState();
            }
        }
        root = minimalDawg[newPartition[0]-1];
    }

    private ArrayList<LatinaDawgNode> buildInitialDawg(ArrayList<LatinaTrieNode> trie) {
        ArrayList<LatinaDawgNode> dawg = new ArrayList<LatinaDawgNode>();
        for (int i = 0; i < trie.size(); i++) {
            dawg.add(new LatinaDawgNode(trie.get(i).getNumChildren()));
        }
        for (int i = 0; i < dawg.size(); i++) {
            LatinaDawgNode dawgNode = dawg.get(i);
            LatinaTrieNode trieNode = trie.get(i);
            LatinaTrieNode child = trieNode.getFirstChild();
            for (int j = 0; j < trieNode.getNumChildren(); j++) {
                dawgNode.addChild(child.getChar(), dawg.get(child.getIndexInTrie()));
                child = child.getSibling();
            }
            if (trieNode.isTerminalState()) dawgNode.setTerminalState();
            dawgNode.setIndexInDawg(i);
        }
        return dawg;
    }

    private ArrayList<LatinaTrieNode> buildTrie() {
        ArrayList<LatinaTrieNode> nodes = new ArrayList<LatinaTrieNode>();
        LatinaTrieNode trieRoot = new LatinaTrieNode();
        nodes.add(trieRoot);
        trieRoot.setIndexInTrie(0);
        Iterator<String> it = wordList.iterator();
        LatinaTrieNode trieNode;
        while (it.hasNext()) {
            String word = (String)it.next();
            trieNode = trieRoot;
            for (int i = 0; i < word.length(); i++) {
                if (!trieNode.hasChild(word.charAt(i))) {
                    LatinaTrieNode newTrieNode = new LatinaTrieNode();
                    trieNode.addChild(word.charAt(i), newTrieNode);
                    nodes.add(newTrieNode);
                    newTrieNode.setIndexInTrie(nodes.size()-1);
                }
                trieNode = trieNode.getChild(word.charAt(i));
            }
            trieNode.setTerminalState();
        }
        return nodes;
    }

    public void leftPart(String partial_word, LatinaDawgNode node, 
    		int limit, String rack, int square, String constraint)	{
    	if(limit > 0)	{
    		for(char edge : node.getEdges())	{
    			if(rack.contains(edge + ""))	{
    				rack = rack.replaceFirst(edge + "", "");
    				LatinaDawgNode node_ = node.getChild(edge);
    				extendRight(partial_word + edge, node_, rack,
    						constraint.substring(square));
    				leftPart(partial_word + edge, node_, 
    			    		limit-1, rack, square, constraint);
    				rack += edge;
    			}
    		}
    	}
    }
    
    public void extendRight(String partial_word, LatinaDawgNode node,
    		String rack, String constraint)	{
    	if(constraint.charAt(0) == '?' || constraint.charAt(0) == '$')	{
    		if(node.isTerminalState())	{
    			legal_word.add(partial_word);
    		}
    		for(char edge : node.getEdges())	{
    			if(rack.contains(edge + ""))	{
    				rack = rack.replaceFirst(edge + "", "");
    				LatinaDawgNode node_ = node.getChild(edge);
    				if(constraint.length() == 1)	{
    					if(node_.isTerminalState())	{
    		    			legal_word.add(partial_word + edge);
    		    		}
    					return;
    				}
    				extendRight(partial_word + edge, node_, 
    						rack, constraint.substring(1));
    				rack += edge;
    			}
    		}
    	}
    	else	{
    		char edge = constraint.charAt(0);
    		if(node.hasEdge(edge))	{
    			LatinaDawgNode node_ = node.getChild(edge);
    			if(constraint.length() == 1)	{
					if(node_.isTerminalState())	{
		    			legal_word.add(partial_word + edge);
		    		}
					return;
				}
    			extendRight(partial_word + edge, node_, 
						rack, constraint.substring(1));
    		}
    	}
    }
    
    public ArrayList<String> getLegalWords()	{
    	return legal_word;
    }
    
    public void clearLegalWords()	{
    	legal_word.clear();
    }
    
